@EU_Commission @vonderleyen @MargSchinas @YlvaJohansson @Ad4EU @EUHomeAffairs It will not be perfect, it's a start.
Do it well. And well intentioned.
There are a lot of rotten apples among us in the EU, who don't want to love.

@EU_Commission @MargSchinas @YlvaJohansson Speaking of balance.. approx how many million people qualify for asylum under EU regulations?

#solidarity 
#MigrationEU

@EU_Commission @MargSchinas @YlvaJohansson Meanwhile, we have some member states breaking European Law and the EU itself is currently breaking international law over treatment of refugees.

What's the one European country doing neither?

Oh, that would be Great Britain

@EU_Commission @Europol @vonderleyen EU member states are not responsible for other member states debts. This is now forced on us.

The same goes for migrants, there is no common burden for EU member states. This is now forced on us. 

This is not what citizens voted for nor were promised upon joining the union.

@EU_Commission @vonderleyen This could go horrible wrong. It might not be the right time for this considering the high levels of unemployment across the EU. 

Remember if you force this migration and asylum issue and you suddenly find high levels of racism, it's your fault.

Your timing is well off.
